import React from 'react';
import './App.css';
import { Layout, Header, Navigation, Drawer, Content } from 'react-mdl';
import 'react-mdl/extra/material.css';
import 'react-mdl/extra/material.js';
import Home from './Home';
import {Link } from 'react-router-dom';

function App() {
  return (
    <div className="demo-big-content" >
        <Layout>
            <Header className='header-color' title="Matthew Barron" scroll>
                <Navigation>
                  <div className='social-links'>
                    <a href="https://www.linkedin.com/in/matthew-barron-b55369185/" target="-blank"><i class="fab fa-linkedin"></i>  </a>
                    <a href="https://github.com/matt-barron" target="-blank"> <i class="fab fa-github-square"></i> </a>
                  </div>
                </Navigation>
            </Header>
            <Drawer title=<Link to="/">Matthew Barron</Link>>
                <img
                src='https://media-exp1.licdn.com/dms/image/C4D03AQEMqZAHzMONmw/profile-displayphoto-shrink_200_200/0?e=1601510400&v=beta&t=R6DXmzpumWdjq6Vk8sGj3nUNwL6F_AIl9GxCENmPt4k'
                alt='Matthew Barron'
                className='my-image'
                />
                <Navigation>
                    <Link to="/education">Education</Link>
                    <Link to="/experience">Experience</Link>
                    <Link to="/projects">Projects</Link>
                    <Link to="skills">Skills</Link>
                </Navigation>
            </Drawer>
            <Content>
                <div className="page-content" />
                <Home/>
            </Content>
        </Layout>
    </div>
  );
}

export default App;
